import React from 'react'
import Input from '@material-ui/core/Input';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Button from '@material-ui/core/Button';
import style from '../Component/css/ForgetPassward.module.scss'
export default function ForgetPassward() {
    return (
        <>
         <form onSubmit={formSubmit} noValidate autoComplete="on">
             <FormControl >
                                        <InputLabel htmlFor="RestPassword">Enter Register Gmail</InputLabel>
                                        <Input
                                            id="RestPassword"
                                            type= 'gmail'
                                            onChange={passwardChange}
                                            placeholder='Enter your gamil'
                                            name="gmail" 
                                            autoComplete="gmail"
                                            
                                        />
                                    </FormControl>
                                
              <Button type="submit" className={style.productButton} size="small">
                       Reset 
              </Button>
        </form>
        </>
    )
}
